import {Routes, Route, useNavigate, renderMatches} from 'react-router-dom';
import logo from './logo.svg';
import gcmateLogo from './img/GCMateIcon.png';
import './App.css';

function App() {
  

  
  return (
    <div className="App">
      <div className="Background"
      style={{
        position: 'absolute',
        backgroundImage: 'url('+gcmateLogo+')',
        backgroundSize: "cover",
        height: "250px", 
        filter: "blur(4px)", 
      }}>
      </div>
      <div className="Foo"><h1>Hi</h1></div> 
    </div>
  );
}

export default App;
